export default () => [
  // prettier-ignore
  <link key="0" rel="apple-touch-icon" sizes="57x57" href="/static/icons/apple-touch-icon-57x57.png" />,
  // prettier-ignore
  <link key="1" rel="apple-touch-icon" sizes="60x60" href="/static/icons/apple-touch-icon-60x60.png" />,
  // prettier-ignore
  <link key="2" rel="apple-touch-icon" sizes="72x72" href="/static/icons/apple-touch-icon-72x72.png" />,
  // prettier-ignore
  <link key="3" rel="apple-touch-icon" sizes="76x76" href="/static/icons/apple-touch-icon-76x76.png" />,
  // prettier-ignore
  <link key="4" rel="apple-touch-icon" sizes="114x114" href="/static/icons/apple-touch-icon-114x114.png" />,
  // prettier-ignore
  <link key="5" rel="apple-touch-icon" sizes="120x120" href="/static/icons/apple-touch-icon-120x120.png" />,
  // prettier-ignore
  <link key="6" rel="apple-touch-icon" sizes="144x144" href="/static/icons/apple-touch-icon-144x144.png" />,
  // prettier-ignore
  <link key="7" rel="apple-touch-icon" sizes="152x152" href="/static/icons/apple-touch-icon-152x152.png" />,
  // prettier-ignore
  <link key="8" rel="apple-touch-icon" sizes="180x180" href="/static/icons/apple-touch-icon-180x180.png" />,
  // prettier-ignore
  <link key="9" rel="icon" type="image/png" sizes="16x16" href="/static/icons/favicon-16x16.png" />,
  // prettier-ignore
  <link key="10" rel="icon" type="image/png" sizes="32x32" href="/static/icons/favicon-32x32.png" />,
  // prettier-ignore
  <link key="11" rel="icon" type="image/png" sizes="96x96" href="/static/icons/favicon-96x96.png" />,
  // prettier-ignore
  <link key="12" rel="icon" type="image/png" sizes="96x96" href="/static/icons/favicon-128.png" />,
  // prettier-ignore
  <link key="13" rel="icon" type="image/png" sizes="96x96" href="/static/icons/favicon-196x196.png" />,
  <meta key="14" name="msapplication-name" content="Hourly" />,
  <meta key="15" name="msapplication-TileColor" content="#0C5193" />,
  <meta key="16" name="theme-color" content="#0C5193" />,
  // prettier-ignore
  <meta key="17" name="msapplication-TileImage" content="/static/icons/mstile-144x144.png" />,
  // prettier-ignore
  <meta key="18" name="msapplication-TileImage" content="/static/icons/mstile-144x144.png" />,
  // prettier-ignore
  <meta key="19" name="msapplication-square70x70logo" content="/static/icons/mstile-70x70.png" />,
  // prettier-ignore
  <meta key="20" name="msapplication-square150x150logo" content="/static/icons/mstile-150x150.png" />,
  // prettier-ignore
  <meta key="21" name="msapplication-wide310x150logo" content="/static/icons/mstile-310x150.png" />,
  // prettier-ignore
  <meta key="22" name="msapplication-square310x310logo" content="/static/icons/mstile-310x310.png" />,
  <meta key="23" name="msapplication-config" content="/static/icons/browserconfig.xml" />,
];
